import { useState } from 'react'

function Barbecue(){
const [adults, setAdults] = useState([])
const [adult, setAdult] = useState()


return(
    <div className='container'>
        <h1 className='barbecue'>Barbecue</h1>
        <input className='inputGlobal' id='adults' onChange={(e)=>setAdult(e.target.value)} name='adults' type='number' placeholder='Adults' value={adults} />
        <button className='calculationGlobal' onClick={([ adults, adult]) => setAdults()}>Calculation</button>
        {adults.map(adult=>(<div>{adult}</div>))}
      </div>
)

}

export default Barbecue
